proxy-groups:
  #  Top-level selector 
  # Only logical groups are shown here  individual proxies are hidden.
  - name: "PROXY-BEST"
    type: select
    proxies:
      - "SCEN-OPEN"
      - "SCEN-CDN"
      - "UDP-BEST"
      - "FAST-ALL"
      - "LB-ALL"
      - "MANUAL"
      - DIRECT

  #  Scenario groups 
  # SCEN-OPEN: best for general open internet (tries load-balance first, falls to fastest)
  - name: "SCEN-OPEN"
    type: fallback
    url: http://www.gstatic.com/generate_204
    interval: 300
    lazy: true
    proxies:
      - "LB-ALL"
      - "FAST-ALL"

  # SCEN-CDN: best for CDN traffic (tries CDN load-balance first, falls to CDN fastest)
  - name: "SCEN-CDN"
    type: fallback
    url: http://cp.cloudflare.com/generate_204
    interval: 300
    lazy: true
    proxies:
      - "LB-CDN"
      - "FAST-CDN"

  #  Load-balance groups 
  # LB-ALL: session-aware load balance across all proxies
  - name: "LB-ALL"
    type: load-balance
    strategy: consistent-hashing
    url: http://www.gstatic.com/generate_204
